import { Component, ViewChild } from '@angular/core';
import { MatPaginator } from '@angular/material/paginator';
import { MatSnackBar } from '@angular/material/snack-bar';
import { MatSort } from '@angular/material/sort';
import { MatTableDataSource } from '@angular/material/table';
import { SupplierService } from 'src/app/service/supplier.service';
import { Supplier } from 'src/app/shared/supplier';

@Component({
  selector: 'app-view-suppliers',
  templateUrl: './view-suppliers.component.html',
  styleUrls: ['./view-suppliers.component.css']
})
export class ViewSuppliersComponent {

  suppliers: Supplier[] = []
  displayedColumns: string[] = ['ID','supplierName', 'supplierType', 'supplierEmail', 'supplierNumber', 'supplierAddress'];
  dataSource = new MatTableDataSource<any>(this.suppliers);

  constructor(private supplierservice: SupplierService, private snackBar: MatSnackBar){

 }
  @ViewChild(MatPaginator) paginator!: MatPaginator;
  @ViewChild(MatSort) sort = new MatSort();

 ngAfterViewInit() {
    this.dataSource.paginator = this.paginator;
    this.dataSource.sort = this.sort;
  }

 applyFilter(event: Event) {
    const filterValue = (event.target as HTMLInputElement).value;
    this.dataSource.filter = filterValue.trim().toLowerCase();
  }

  ngOnInit(): void {
    this.GetAllSuppliers()
    console.log(this.suppliers)

  }

  GetAllSuppliers()
  {
     this.supplierservice.GetAllSuppliers().subscribe(
       (result) => {
         let supplierList: any[] = result[1];
         supplierList.forEach((element) => {
           this.suppliers.push(element);
         });

         this.dataSource = new MatTableDataSource<any>(this.suppliers);
       },
     );
  }

}
<div class="container-fluid">
    <div class="row">
        <div class="col-md-2">
            <app-navbar></app-navbar>
        </div>
    <div class="col-md-10 order-md-1">
        <h4 style="text-align: center; font-family: 'Times New Roman', Times, serif; font-size: 25px;">Supplier Listing</h4>

        <div class="row">
          <div class="col-md-12">
            <mat-form-field>
              <mat-label>Filter</mat-label>
              <input matInput (keyup)="applyFilter($event)" placeholder="Search Columns" #input>
            </mat-form-field>
            <table mat-table [dataSource]="dataSource" matSort>

                <ng-container matColumnDef="ID">
                    <th mat-header-cell *matHeaderCellDef mat-sort-header> ID </th>
                    <td mat-cell *matCellDef="let suppliers"> {{suppliers.supplierID}} </td>
                  </ng-container>


                <ng-container matColumnDef="supplierName">
                    <th mat-header-cell *matHeaderCellDef mat-sort-header> Name </th>
                    <td mat-cell *matCellDef="let suppliers"> {{suppliers.supplierName}} </td>
                  </ng-container>

                  <ng-container matColumnDef="supplierType">
                    <th mat-header-cell *matHeaderCellDef mat-sort-header> Type </th>
                    <td mat-cell *matCellDef="let suppliers"> {{suppliers.supplierType}} </td>
                  </ng-container>

                  <ng-container matColumnDef="supplierEmail">
                    <th mat-header-cell *matHeaderCellDef mat-sort-header> Email Address </th>
                    <td mat-cell *matCellDef="let suppliers"> {{suppliers.supplierEmail}} </td>
                  </ng-container>

                  <ng-container matColumnDef="supplierNumber">
                    <th mat-header-cell *matHeaderCellDef mat-sort-header> Phone Number </th>
                    <td mat-cell *matCellDef="let suppliers"> {{suppliers.supplierNumber}} </td>
                  </ng-container>

                  <ng-container matColumnDef="supplierAddress">
                    <th mat-header-cell *matHeaderCellDef mat-sort-header> Physical Address </th>
                    <td mat-cell *matCellDef="let suppliers"> {{suppliers.supplierAddress}} </td>
                  </ng-container>

                  <tr mat-header-row *matHeaderRowDef="displayedColumns"></tr>
                  <tr mat-row *matRowDef="let row; columns: displayedColumns;"></tr>
            </table>
            <app-supplier-table [supplierList]="suppliers"></app-supplier-table>
          </div>
        </div>
      </div>
    </div>
  </div>
